// src/pages/HomePage.jsx
import React from 'react';
import { Link } from 'react-router-dom';

// Se define el componente HomePage
const HomePage = () => {
  return (
    <div>
      <h1>Bienvenido a VERANUM</h1>
      <p>Modernizando la hospitalidad para ofrecerle la mejor experiencia.</p>
      <Link to="/reservar">
        <button style={{ padding: '10px 20px', fontSize: '16px', cursor: 'pointer' }}>
            Realizar una Reserva
        </button>
      </Link>
    </div>
  );
};

// LA LÍNEA CLAVE:
// Esto hace que el componente esté disponible para que otros archivos lo importen.
export default HomePage;
